  <body>
    <!--https://developer.apple.com/library/safari/documentation/AppleApplications/Reference/SafariHTMLRef/Articles/MetaTags.html-->
    <meta name="apple-mobile-web-app-capable" content="yes" />
    <meta
      name="apple-mobile-web-app-status-bar-style"
      content="black-translucent"
    />
    <meta name="format-detection" content="telephone=no" />
    <!-- force webkit on 360 -->
    <meta name="renderer" content="webkit" />
    <meta name="force-rendering" content="webkit" />
    <!-- force edge on IE -->
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
    <meta name="msapplication-tap-highlight" content="no" />
    <!-- force full screen on some browser -->
    <meta name="full-screen" content="yes" />
    <meta name="x5-fullscreen" content="true" />
    <meta name="360-fullscreen" content="true" />
    <!--fix fireball/issues/3568 -->
    <!--<meta name="browsermode" content="application">-->
    <meta name="x5-page-mode" content="app" />
    <style>
      * {
        box-sizing: border-box;
        overflow: hidden;
      }

      body {
        margin: 0;
        font-family: Arial;
        font-size: 17px;
        -webkit-user-select: none;
        -webkit-touch-callout: none;
        touch-action: none;
      }

      img {
        pointer-events: none;
      }
      .content {
        position: fixed;
        bottom: 0;
        background: rgba(0, 0, 0, 0.5);
        color: #f1f1f1;
        width: 100%;
        padding: 20px;
      }

      .allscreen {
        position: absolute;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
        height: 100%;
        width: 100%;
      }

      #allscreenBtn {
        width: 100%;
        height: 100%;
        font-size: 18px;
        padding: 10px;
        border: none;
        background: rgba(0, 0, 0, 0);
        color: rgba(0, 0, 0, 0);
      }

      #container {
        position: relative;
        width: 100vh;
        height: 100vh;
      }

      #loopVideo {
        position: absolute;
        left: 0%;
        top: 0%;
        width: 100%;
        height: 100%;
      }

      #TutorHand {
        position: absolute;
        opacity: 0;
        width: 10%;
      }

      #CtaLogo {
        position: absolute;
        width: 12%;
        bottom: 2%;
        left: 3%;
      }

      #CtaDownload {
        position: absolute;
        width: 12%;
        bottom: 2%;
        right: 3%;
      }

      #LoadingBack {
        position: absolute;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
        height: 100%;
        min-width: 100%;
        z-index: 100;
      }

      #LoadingLogo {
        position: fixed;
        width: 30%;
        bottom: 45%;
        left: 35%;
        z-index: 101;
      }
    </style>

      let failBottomStep;

      function updateFail() {
        if (!isFail) {
          isFail = true;
        }
        if (window.innerWidth > window.innerHeight) {
          logo.style.width = logoWidthPackL + "%";
          logo.style.left = logoLeftPackL + "%";
          logo.style.top = "";
          logo.style.bottom = logoBottomPackL + "%";
          downloadBtnImage.style.width = downloadWidthPackL + "%";
          downloadBtnImage.style.right = downloadRightPackL + "%";
          downloadBtnImage.style.bottom = downloadBottomPackL + "%";
        } else {
          logo.style.width = logoWidthPackP + "%";
          logo.style.left = logoLeftPackP + "%";
          logo.style.top = logoTopPackP + "%";
          downloadBtnImage.style.width = downloadWidthPackP + "%";
          downloadBtnImage.style.right = downloadRightPackP + "%";
          downloadBtnImage.style.bottom =
            innerHeight / 2.0 - downloadBtnImage.naturalHeight / 2.0 + "px";
        }
      }

      function pingPongElPosition(
        el,
        anchorX,
        anchorY,
        startPos,
        endPos,
        cPos,
        totalTime,
        timeLeft,
        currTime,
        direction,
        tween
      ) {
        if (!tween) {
          tween = { isContinue: true };
        }
        const timeDelta = performance.now() - currTime;
        const velX =
          direction > 0
            ? (endPos.x - cPos.x) / timeLeft
            : (startPos.x - cPos.x) / timeLeft;
        const velY =
          direction > 0
            ? (endPos.y - cPos.y) / timeLeft
            : (startPos.y - cPos.y) / timeLeft;
        cPos.x += velX * timeDelta;
        cPos.y += velY * timeDelta;
        setSpritePos(el, cPos.x, cPos.y, anchorX, anchorY);
        timeLeft -= timeDelta;
        currTime = performance.now();
        if (tween.isContinue) {
          if (timeLeft > 0) {
            setTimeout(
              () =>
                pingPongElPosition(
                  el,
                  anchorX,
                  anchorY,
                  startPos,
                  endPos,
                  cPos,
                  totalTime,
                  timeLeft,
                  currTime,
                  direction,
                  tween
                ),
              17
            );
          } else {
            if (direction > 0) {
              cPos.x = endPos.x;
              cPos.y = endPos.y;
              direction = -1;
            } else {
              cPos.x = startPos.x;
              cPos.y = startPos.y;
              direction = 1;
            }
            timeLeft = totalTime;
            setTimeout(
              () =>
                pingPongElPosition(
                  el,
                  anchorX,
                  anchorY,
                  startPos,
                  endPos,
                  cPos,
                  totalTime,
                  timeLeft,
                  currTime,
                  direction,
                  tween
                ),
              17
            );
          }
        }
        return tween;
      }
      setTimeout(updateFail, 25900);
      setTimeout(() => {
        tutorHand.style.opacity = 1;
        if (window.innerWidth > window.innerHeight) {
          let startX = joystickXL;
          let startY = joystickYL;
          let tweenY = joystickTweenYL;
          cTweenHand = pingPongElPosition(
            tutorHand,
            tutorHandAnchorX,
            tutorHandAnchorY,
            { x: startX, y: startY },
            { x: startX, y: tweenY },
            { x: startX, y: startY },
            tweenTime,
            tweenTime,
            performance.now(),
            1,
            null
          );
        } else {
          let startX = joystickXP;
          let startY = joystickYP;
          let tweenY = joystickTweenYP;
          cTweenHand = pingPongElPosition(
            tutorHand,
            tutorHandAnchorX,
            tutorHandAnchorY,
            { x: startX, y: startY },
            { x: startX, y: tweenY },
            { x: startX, y: startY },
            tweenTime,
            tweenTime,
            performance.now(),
            1,
            null
          );
        }
      }, 7000);
      setTimeout(() => {
        tutorHand.style.opacity = 0;
      }, 24500);
      onresize();
      let clickCount = 0;

      function tryToUnmute() {
        audio.muted = window.muteByMraid || window.muteUntilFirstClick;
        if (audio.muted === false) {
          audio.play();
          audio.currentTime = video.currentTime;
        }
      }

      function tryToRedirect() {
        if (clickCount + 1 < clickCountToStore) {
          ++clickCount;
        } else {
          redirect();
        }
      }

      function redirect() {
        const androidUrl =
          "https://play.google.com/store/apps/details?id=asrtum.ent.domovyata";
        const iOsUrl =
          "https://apps.apple.com/ru/app/%D0%BC%D0%B8%D1%80-%D0%B4%D0%BE%D0%BC%D0%BE%D0%B2%D1%8F%D1%82-%D1%82%D1%80%D0%B8-%D0%B2-%D1%80%D1%8F%D0%B4/id6618155197";
        const storeLink = /android/i.test(navigator.userAgent)
          ? androidUrl
          : iOsUrl;
        AdRedirectProcessing(storeLink);
      }

      function openStoreUrl(url) {
        if (url) {
          if (typeof mraid !== "undefined") {
            mraid.open(url);
          } else {
            window.open(url);
          }
        }
      }

      function mraidIsReady() {
        if (mraid.isViewable()) {
          mraid.removeEventListener("ready", mraidIsReady);
          showMyAd();
        } else {
          mraid.addEventListener("viewableChange", mraidIsViewable);
        }
      }

      function mraidIsViewable(isViewable) {
        if (isViewable) {
          video.play();
          audio.play();
        } else {
          video.pause();
          audio.pause();
        }
      }

      function showMyAd() {
        video.play();
        audio.play();
      }

      function doReadyCheck() {
        if (mraid !== "undefined") {
          mraid.addEventListener("audioVolumeChange", volumeChange);
        }

        if (typeof mraid !== "undefined" && mraid.getState() == "loading") {
          mraid.addEventListener("ready", mraidIsReady);
        } else {
          showMyAd();
        }
      }

      function AdRedirectProcessing(url) {
        openStoreUrl(url);
      }

      function volumeChange(e) {
        window.muteByMraid = !e;
        audio.muted = window.muteByMraid || window.muteUntilFirstClick;
      }

      window.muteByMraid = false;
      window.muteUntilFirstClick = true;
      doReadyCheck();
    </script>
  </body>
</html>
